window.bookSummaryJSON = "<p>The world has collapsed, and there are no heroes any more. His name is Three, a travelling gun for hire in a dying world. He has no allegiances, no family, no ties.</p> <p>Against his better judgment, he accepts the mantle of protector to a sick woman on the run, and her young son. Together they set out across the plains in search of a mythic oasis, attempting to survive the forces that pursue them, and the creatures of the dark.</p> <p>In these dark times, a hero may yet arise.</p>"; 
